    window.select_region = function(province_id,city_id,district_id){
        var province = '<option value="0">--</option>';
        var city = '<option value="0">--</option>';
        var district = '<option value="0">--</option>';
        for (var  k in region) {
            if(region[k].level == 0){
                //
                if(region[k].id == province_id){
                    province += '<option value="'+region[k].id+'" selected>'+region[k].name+'</option>';
                }else{
                    province += '<option value="'+region[k].id+'">'+region[k].name+'</option>';
                }
            }
            if(region[k].level == 1){
                //
                if(region[k].parent_id == province_id){
                    if(region[k].id == city_id){
                        city += '<option value="'+region[k].id+'" selected>'+region[k].name+'</option>';
                    }else{
                        city += '<option value="'+region[k].id+'">'+region[k].name+'</option>';
                    }
                }
            }
            if(region[k].level == 2){
                //
                if(region[k].parent_id == city_id){
                    if(region[k].id == district_id){
                        district += '<option value="'+region[k].id+'" selected>'+region[k].name+'</option>';
                    }else{
                        district += '<option value="'+region[k].id+'">'+region[k].name+'</option>';
                    }
                }
            }
        }
        $('#regoin').find('.province').html(province);
        $('#regoin').find('.city').html(city);
        $('#regoin').find('.district').html(district);
    }

    window.show_region = function(){
        var province = '<option value="0">--</option>';
        var city = '<option value="0">--</option>';
        var district = '<option value="0">--</option>';
        for (var  k in region) {
            if(region[k].level == 0){
                province += '<option value="'+region[k].id+'">'+region[k].name+'</option>';
            }
        }
        $('#regoin').find('.province').html(province);
        $('#regoin').find('.city').html(city);
        $('#regoin').find('.district').html(district);
    }

    $('#regoin').on('change','.province',function(){
        var city = '<option value="0">--</option>';
        var district = '<option value="0">--</option>';
        var value = $(this).val();
        if(value > 0){
            for (var  k in region) {
                if(region[k].parent_id == value){
                    city += '<option value="'+region[k].id+'">'+region[k].name+'</option>';
                }
            }
        }
        $('#regoin').find('.city').html(city);
        $('#regoin').find('.district').html(district);
    });

    $('#regoin').on('change','.city',function(){
        var district = '<option value="0">--</option>';
        var value = $(this).val();
        if(value  > 0){
            for (var  k in region) {
                if(region[k].parent_id == value){
                    district += '<option value="'+region[k].id+'">'+region[k].name+'</option>';
                }
            }

        }
        $('#regoin').find('.district').html(district);

    });



